import React, { Component } from "react";

class Login extends Component {
  render() {
    return (
      <div className="App">
        <h1>Login user</h1>
        <label>
          Username:
          <input type="text" name="username"></input>
        </label>
        <br />
        <label>
          Password:
          <input type="text" name="password"></input>
        </label>
        <br />
        <button onClick={this.login}>Login</button>
      </div>
    );
  }
}

export default Login;
